import React from 'react'

import './LinerProsentage.scss'



const LineerProsentage = ({prosentage}) => {
    let num = Math.floor(prosentage/10)
    var ovals = []
    for(let i = 0; i < num; i++){
        ovals.push(<div key={`oval-fill${i.toString()}`} className="oval-fill mx-1"/>)
    }

    console.log(ovals)

    if(!(ovals.length===10)){
        for(let j = 0; j < (10-num); j++){
            ovals.push(<div key={`oval-${j}`} className="oval mx-1"/>)
        }
    }

    let res

    if (Math.floor(prosentage/10) <= 3){
        res = 'beginner'
    } if (Math.floor(prosentage/10) <= 8 && Math.floor(prosentage/10)>3) {
        res ='fluent'
    } else res = 'native'

    return (
        <div>
            <h6 className="mb">English</h6>
            <div className="d-flex">
                {ovals.map((e) => e)}
                <span>
                    {res}
                </span>
            </div>
        </div>
    )

}

export default LineerProsentage
